import React, { Component } from "react";
import "./App.css";


class App extends Component {

  styles = {
    backgroundImg: {
      backgroundImage: `url("https://hutchingspianos.com.au/wp-content/uploads/2017/06/Piano-Keys-Background.png")`,
      height: '100px',
      width: '1000px',
      backgroundColor: "red",
      backgroundRepeat: 'no-repeat',
      backgroundPosition: 'center',
      backgroundSize: 'cover'

    },
    menu: {
      textAlignLast: "right",
      paddingRight: '100px',
      color: 'white'
    },
    jumbotron: {
      // backgroundImage: `url("https://hutchingspianos.com.au/wp-content/uploads/2017/06/Piano-Keys-Background.png")`,
      backgroundPosition: "bottom",
      backgroundColor: 'black',
      backgroundSize: "cover"
    },

    jumbotronOne: {
      color: 'white'
    },
    jumbotronP: {
      color: "white"
    }
  }
  render() {
    return (
      <div className='app'>
        <div style={this.styles.jumbotron}>
          <div className="container">
            <h1 style={{ color: 'white' }}>Markable Music</h1>
            <p style={{ color: 'white' }}>Make it sound remarkable</p>
          </div>
          <div style={this.styles.menu} id="menu">
            <p>Keys or Drums</p>
            <p>Pick a Key</p>
            <p>BPM</p>
            <p>0:00</p>
            <button>Record</button>
            <button>Play Button</button>
            <button>Stop</button>
            <p>Metronome</p>
            <button>Save</button>
            <button>Logout</button>
          </div>
        </div>
        <div >asFASDFD</div>
      </div>
    );
  }
}

export default App;
